import {Link} from "react-router-dom";

const SellerHeader = () =>{
    return(
    <div className="row">
        <div className="col-lg-3">
            <h1 className="text-danger"> <i className="fa fa-shopping-bag"></i>Seller app</h1>
        </div>
        <div className="col-lg-9">
            <div className="btn-group">
                <button className="btn btn-danger"><i className="fa fa-home"></i> Dashboard </button>
                <button className="btn btn-info"><i className="fa fa-table"></i> All Items </button>
                <button className="btn btn-primary"><i className="fa fa-plus"></i> Add Item </button>
                <button className="btn btn-success"><i className="fa fa-headset"></i> Order List </button>
                <button className="btn btn-warning"> Welcome - {localStorage.getItem("fullname") } Logout<i className="fa fa-power-off"></i>  </button>
            </div>
        </div>
       
    </div>
    )
}

export default SellerHeader;
